<!DOCTYPE html>
<html lang="zh-CN">
<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0, maximum-scale=1.0, user-scalable=no">
    <title>iPhone 17 pro自定义背板贴纸工具</title>
    <style>
        :root {
            --primary-color: #0071e3;
            --bg-color: #f5f5f7;
            --panel-width: 320px;
        }

        body {
            font-family: -apple-system, BlinkMacSystemFont, "Segoe UI", Roboto, sans-serif;
            background-color: var(--bg-color);
            display: flex;
            flex-direction: column;
            align-items: center;
            padding: 30;
            user-select: none;
            min-height: 100vh;
            /* 防止iOS回弹效果影响体验 */
            overscroll-behavior: none;
        }

        h1 { color: #1d1d1f; margin-bottom: 20px; font-weight: 600; }

        .main-container {
            display: flex;
            flex-direction: row;
            gap: 30px;
            align-items: flex-start;
            background: #fff;
            padding: 30px;
            border-radius: 24px;
            box-shadow: 0 10px 30px rgba(0,0,0,0.08);
        }

        /* --- 左侧舞台 --- */
        #design-stage {
            position: relative;
            width: 320px;
            height: 632px;
            background-color: #f9f9f9;
            border-radius: 20px;
            overflow: hidden;
            border: 1px solid #e5e5e5;
            flex-shrink: 0;
            /* 阻止默认触摸行为 */
            touch-action: none;
        }

        #phone-bg {
            width: 100%; height: 100%;
            background-size: contain; background-repeat: no-repeat; background-position: center;
            pointer-events: none; z-index: 1;
            background-image: url('https://placehold.co/380x750/e3e3e3/333?text=Silver+iPhone');
        }

        /* --- 贴纸框 (位置固定) --- */
        #sticker-frame {
            position: absolute;
            top: 241px; 
            left: 71px; 
            width: 174px; 
            height: 266px;
            border-radius: 24px; 
            overflow: hidden; 
            z-index: 10;
            background-color: rgba(0, 113, 227, 0.1);
            border: 2px dashed var(--primary-color);
            cursor: grab; 
            display: flex; align-items: center; justify-content: center;
        }

        #sticker-frame:active { cursor: grabbing; }

        /* 内部图片 */
        #user-image {
            position: absolute;
            top: 0; left: 0;
            width: 100%; 
            display: none; 
            transform-origin: top left;
            pointer-events: none; 
        }
        
        #sticker-frame.has-image {
            background-color: transparent;
            border: 1px dashed rgba(255, 255, 255, 0.5); 
        }
        #sticker-frame.has-image span { display: none; }

        /* --- 右侧控制面板 --- */
        .controls-panel {
            width: var(--panel-width);
            display: flex; flex-direction: column; gap: 20px;
        }

        .control-section {
            background: #fbfbfd; padding: 20px; border-radius: 16px; border: 1px solid #ebebeb;
        }

        .section-title { font-size: 14px; font-weight: 600; color: #86868b; margin-bottom: 15px; display: block; }

        .control-row { display: flex; align-items: center; margin-bottom: 12px; }
        label.param-label { width: 50px; font-size: 13px; font-weight: 500; color: #333; }
        .value-display { width: 45px; text-align: right; font-size: 12px; color: var(--primary-color); font-weight: bold; font-family: monospace;}
        input[type=range] { flex: 1; margin: 0 10px; cursor: pointer; accent-color: var(--primary-color); }

        .color-dots { display: flex; gap: 10px; justify-content: center; margin-bottom: 15px;}
        .dot { width: 30px; height: 30px; border-radius: 50%; border: 2px solid #ddd; cursor: pointer; }
        .dot.active { border-color: var(--primary-color); transform: scale(1.1); }

        .btn { border: none; border-radius: 12px; font-weight: 600; cursor: pointer; transition: 0.2s; display: block; text-align: center;}
        
        .btn-upload {
            background: #e8e8ed; color: #1d1d1f; 
            width: 140px; padding: 10px 0; margin: 0 auto; 
            border-radius: 20px; font-size: 13px;
        }
        .btn-upload:hover { background: #d2d2d7; }

        .btn-save {
            width: 100%; padding: 14px; background: var(--primary-color); color: white;
            font-size: 15px; box-shadow: 0 4px 10px rgba(0,113,227,0.3);
        }
        .btn-save:hover { opacity: 0.9; }

        input[type="file"] { display: none; }
        .tip { font-size: 12px; color: #86868b; text-align: center; margin-top: 10px; }

        @media (max-width: 800px) { .main-container { flex-direction: column; align-items: center; } }
    </style>
</head>

            <div class="control-section">
                <span class="section-title">2. 参数微调</span>
                
                <div class="control-row"><label class="param-label">宽(W)</label>
                    <input type="range" min="150" max="300" value="207" oninput="updateStyle('width', this.value)">
                    <span class="value-display" id="val-width">207px</span>
                </div>
                <div class="control-row"><label class="param-label">高(H)</label>
                    <input type="range" min="250" max="400" value="316" oninput="updateStyle('height', this.value)">
                    <span class="value-display" id="val-height">316px</span>
                </div>
                <div class="control-row"><label class="param-label">圆角</label>
                    <input type="range" min="0" max="60" value="29" oninput="updateStyle('radius', this.value)">
                    <span class="value-display" id="val-radius">29px</span>
                </div>

                <div class="control-row" style="border-top:1px solid #eee; padding-top:10px; margin-top:10px;">
                    <label class="param-label">图缩放</label>
                    <input id="scale-range" type="range" min="20" max="300" value="100" oninput="updateImageScale(this.value)">
                    <span class="value-display" id="val-scale">100%</span>
                </div>
                <p style="text-align:center; font-size:12px; color:#666; margin:0;">👆 提示：单指拖拽移动，双指捏合缩放</p>
            </div>

            <button class="btn btn-save" onclick="saveSticker()">
                💾 保存高清贴纸
            </button>
        </div>
    </div>

    <script src="https://cdnjs.cloudflare.com/ajax/libs/html2canvas/1.4.1/html2canvas.min.js"></script>
    
    <script>
        const frame = document.getElementById('sticker-frame');
        const userImg = document.getElementById('user-image');
        const phoneBg = document.getElementById('phone-bg');
        let hasImage = false;

        // UI 更新
        function updateStyle(type, val) {
            if (type === 'width') {
                frame.style.width = val + 'px';
                document.getElementById('val-width').innerText = val + 'px';
            } else if (type === 'height') {
                frame.style.height = val + 'px';
                document.getElementById('val-height').innerText = val + 'px';
            } else if (type === 'radius') {
                frame.style.borderRadius = val + 'px';
                document.getElementById('val-radius').innerText = val + 'px';
            }
        }

        function updateImageScale(val) {
            if(!hasImage) return;
            userImg.style.width = val + '%';
            document.getElementById('val-scale').innerText = Math.round(val) + '%';
            // 确保滑块位置同步 (双指缩放时用到)
            document.getElementById('scale-range').value = val;
        }

        // --- 核心：触摸逻辑 (支持单指拖拽 + 双指缩放) ---
        let isDragging = false;
        
        // 拖拽变量
        let startX, startY, imgStartLeft, imgStartTop;
        
        // 缩放变量
        let startDist = 0;
        let startScaleVal = 100;

        frame.addEventListener('touchstart', handleTouchStart, {passive: false});
        frame.addEventListener('touchmove', handleTouchMove, {passive: false});
        frame.addEventListener('touchend', handleTouchEnd);
        // 兼容鼠标拖拽
        frame.addEventListener('mousedown', handleMouseDown);

        function getDistance(touches) {
            const dx = touches[0].clientX - touches[1].clientX;
            const dy = touches[0].clientY - touches[1].clientY;
            return Math.sqrt(dx * dx + dy * dy);
        }

        function handleTouchStart(e) {
            if (!hasImage) return;
            // 重要：防止页面滚动
            if (e.cancelable) e.preventDefault();

            if (e.touches.length === 1) {
                // ---> 单指：准备拖拽
                isDragging = true;
                startX = e.touches[0].clientX;
                startY = e.touches[0].clientY;
                imgStartLeft = userImg.offsetLeft;
                imgStartTop = userImg.offsetTop;
            } else if (e.touches.length === 2) {
                // ---> 双指：准备缩放
                isDragging = false; // 双指时暂停拖拽
                startDist = getDistance(e.touches);
                // 获取当前图片的缩放百分比 (从滑块获取最准)
                startScaleVal = parseFloat(document.getElementById('scale-range').value);
            }
        }

        function handleTouchMove(e) {
            if (!hasImage) return;
            if (e.cancelable) e.preventDefault();

            if (e.touches.length === 1 && isDragging) {
                // ---> 单指：执行拖拽
                const dx = e.touches[0].clientX - startX;
                const dy = e.touches[0].clientY - startY;
                userImg.style.left = (imgStartLeft + dx) + 'px';
                userImg.style.top = (imgStartTop + dy) + 'px';
            } else if (e.touches.length === 2) {
                // ---> 双指：执行缩放
                const newDist = getDistance(e.touches);
                if (startDist > 0) {
                    const scaleFactor = newDist / startDist;
                    let newScale = startScaleVal * scaleFactor;
                    
                    // 限制缩放范围 (20% - 300%)
                    if (newScale < 20) newScale = 20;
                    if (newScale > 300) newScale = 300;

                    // 应用缩放并同步滑块
                    updateImageScale(newScale);
                }
            }
        }

        function handleTouchEnd(e) {
            isDragging = false;
        }

        // --- 鼠标拖拽兼容 (仅单指逻辑) ---
        function handleMouseDown(e) {
            if (!hasImage) return;
            e.preventDefault();
            isDragging = true;
            startX = e.clientX;
            startY = e.clientY;
            imgStartLeft = userImg.offsetLeft;
            imgStartTop = userImg.offsetTop;
            document.addEventListener('mousemove', onMouseMove);
            document.addEventListener('mouseup', onMouseUp);
        }

        function onMouseMove(e) {
            if (!isDragging) return;
            const dx = e.clientX - startX;
            const dy = e.clientY - startY;
            userImg.style.left = (imgStartLeft + dx) + 'px';
            userImg.style.top = (imgStartTop + dy) + 'px';
        }

        function onMouseUp() {
            isDragging = false;
            document.removeEventListener('mousemove', onMouseMove);
            document.removeEventListener('mouseup', onMouseUp);
        }


        // --- 文件上传 ---
        document.getElementById('fileInput').addEventListener('change', function(e) {
            const file = e.target.files[0];
            if(file) {
                const reader = new FileReader();
                reader.onload = function(evt) {
                    userImg.src = evt.target.result;
                    userImg.style.display = 'block';
                    frame.classList.add('has-image');
                    hasImage = true;
                    // 重置
                    userImg.style.top = '0px'; 
                    userImg.style.left = '0px';
                    updateImageScale(100);
                }
                reader.readAsDataURL(file);
            }
        });

        // --- 背景切换 ---
        window.changeBg = function(el, src) {
            document.querySelectorAll('.dot').forEach(d => d.classList.remove('active'));
            el.classList.add('active');
            phoneBg.style.backgroundImage = `url('${src}')`;
        }

        // --- 保存逻辑 ---
        window.saveSticker = function() {
            if(typeof html2canvas === 'undefined') {
                alert("组件加载中，请稍后..."); return;
            }
            const btn = document.querySelector('.btn-save');
            const originalText = btn.innerText;
            btn.innerText = "生成中...";
            btn.disabled = true;

            const originalW = frame.offsetWidth;
            const originalH = frame.offsetHeight;
            const originalRadius = getComputedStyle(frame).borderRadius;
            const imgTop = userImg.offsetTop;
            const imgLeft = userImg.offsetLeft;
            const imgWidth = userImg.offsetWidth;
            
            const scale = 4; // 4倍高清

            // 放大 Frame
            frame.style.width = (originalW * scale) + "px";
            frame.style.height = (originalH * scale) + "px";
            frame.style.borderRadius = (parseInt(originalRadius) * scale) + "px";
            frame.style.border = "none"; 
            
            // 放大 Image
            userImg.style.width = (imgWidth * scale) + "px";
            userImg.style.top = (imgTop * scale) + "px";
            userImg.style.left = (imgLeft * scale) + "px";

            frame.classList.remove('has-image');
            frame.style.backgroundColor = 'transparent';

            html2canvas(frame, {
                scale: 1, backgroundColor: null, logging: false, useCORS: true
            }).then(canvas => {
                // 还原
                frame.style.width = originalW + "px";
                frame.style.height = originalH + "px";
                frame.style.borderRadius = originalRadius;
                frame.style.border = "";
                frame.classList.add('has-image');
                
                const scaleVal = document.getElementById('scale-range').value;
                userImg.style.width = scaleVal + '%';
                userImg.style.top = imgTop + "px";
                userImg.style.left = imgLeft + "px";

                const link = document.createElement('a');
                link.download = `Sticker_Cut_HD.png`;
                link.href = canvas.toDataURL('image/png');
                link.click();
                
                btn.innerText = originalText;
                btn.disabled = false;
            }).catch(e => {
                alert("保存失败，请检查跨域问题");
                location.reload();
            });
        }
    </script>
</body>
</html>
